import { useState } from "react";
import Home from "./Home";
import About from "./About";

function Main() {
    const [page, setPage] = useState("Home");
    return (
        <main>
            <NavBar setPage={setPage}/>
            {page === "Home" && <Home/>}
            {page === "About" && <About/>}
        </main>
    );
}
export default Main;
